// src/BusinessCard.js

import React from 'react';
import './BusinessCard.css';
import { FaGithub, FaDiscord, FaYoutube } from 'react-icons/fa';
import { GiAustralia, GiSouthAfrica, GiGamepad } from 'react-icons/gi';

const BusinessCard = () => {
  return (
    <div className="card">
      <h1 className="name">Cr1ppl3</h1>
      <h2 className="alias">Developer from Sydney, Australia</h2>
      <p className="details">
        I'm the developer of a game-enhancing software, and I do freelance work. <br />
        <span className="flag"><GiAustralia /> Sydney, Australia</span><br />
        <span className="flag"><GiSouthAfrica /> Born in South Africa</span><br />
        <span className="experience">10 years of experience | Age: 27</span>
      </p>
      <p className="skills">
        Skills: C++, C#, Python, PHP, HTML, JS, Java
      </p>
      <div className="links">
        <a href="https://github.com/Cr1ppl3" target="_blank" rel="noopener noreferrer">
          <FaGithub /> GitHub
        </a>
        <a href="https://discord.com" target="_blank" rel="noopener noreferrer">
          <FaDiscord /> Discord
        </a>
        <a href="https://youtube.com" target="_blank" rel="noopener noreferrer">
          <FaYoutube /> YouTube
        </a>
      </div>
      <div className="software">
        <GiGamepad /> Game-Enhancing Software
      </div>
    </div>
  );
};

export default BusinessCard;
